INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (126, 1, 10, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.1', 'ПАБ-17.280ЖД.39.к.о.8', 'Восточно-Крымский ИКМЗ', 'КП-192246', 'Амфоры синопской стенки с верхним прилепом овальной ручки фрагмент. На верхней площадке ручки оттиск рельефного трехстрочного клейма в подпрямоугольном поле.', 'амфора', 'фрагмент', '7.5YR', '6', '6', '7.5YR 6/6', 'Reddish Yellow');
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (127, 1, 6, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.1', 'ПАБ-17.280ЖД.52.к.о.9', 'Восточно-Крымский ИКМЗ', 'КП-192247', 'Амфоры косской ручки двуствольной фрагмент. На верхней площадке одного из стволов ручки рельефное однострочное ретроградное клеймо в рамке в виде вытянутого овала.', 'амфора', 'фрагмент', '5Y', '7', '3', '5Y 7/3', 'Pale Yellow');
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (128, 1, 9, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.2', 'ПАБ-17.280ЖД.7.к.о.25', 'Восточно-Крымский ИКМЗ', 'НВФ-19632', 'Амфоры родосской венчика в виде трапециевидного валика со скошенным внутренним краем с прилепом овальной ручки от горла фрагмент. На верхней площадке ручки оттиск плохо сохранившегося рельефного клейма в узкой подпрямоугольной рамке. Клеймо повреждено не определяется. Изгиб ручки плавный.', 'амфора', 'фрагмент', NULL, NULL, NULL, '/', NULL);
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (129, 1, 10, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.2', 'ПАБ-17.280ЖД.17.к.о.26', 'Восточно-Крымский ИКМЗ', 'КП-192251', 'Амфоры синопской венчика валикообразного с подрезкой при переходе к пухлому в верхней части горлу с прилепом овальной ручки с частично сохранившимся клеймом в подпрямоугольной рамке фрагмент. Клеймо рельефное в подпрямоугольном поле в три строки.', 'амфора', 'фрагмент', '10YR', '6', '4', '10YR 6/4', 'Light Yellowish Brown');
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (130, 1, 10, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.2', 'ПАБ-17.280ЖД.18.к.о.27', 'Восточно-Крымский ИКМЗ', 'КП-192252', 'Амфоры синопской ручки овальной фрагмент. На верхней площадке ручки оттиск рельефного клейма в подпрямоугольной рамке в три строки.', 'амфора', 'фрагмент', '10YR', '6', '6', '10YR 6/6', 'Brownish Yellow');
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (131, 1, 9, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.4', 'ПАБ-17.280ЖД.5.к.о.34', 'Восточно-Крымский ИКМЗ', 'НВФ-19638', 'Амфоры родосской венчика валикообразного с прилепом овальной ручки с клеймом в подпрямоугольной рамке фрагмент. Изгиб ручки плавный. Клеймо затёрто не читается.', 'амфора', 'фрагмент', NULL, NULL, NULL, '/', NULL);
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (132, 1, 9, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.5', 'ПАБ-17.280ЖД.13.к.о.40', 'Восточно-Крымский ИКМЗ', 'НВФ-19643', 'Амфоры родосской ручки округлой с остатками клейма фрагмент. Клеймо рельефное в подпрямоугольном поле в точечной рамке.', 'амфора', 'фрагмент', NULL, NULL, NULL, '/', NULL);
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (133, 1, 15, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.6', 'ПАБ-17.280ЖД.4.к.о.44', 'Восточно-Крымский ИКМЗ', 'НВФ-19647', 'Амфоры неопределенного центра стенки с верхним прилепом овальной ручки с клеймом фрагмент. Глина желтовато-коричневая рыхлая с большим количеством песка вкраплениями пироксена и золотистой слюды. Клеймо рельефное в подпрямоугольной рамке анэпиграфное. С тремя эмблемами: канфар лист плюща и лабрис. Глина желтовато-коричневая рыхлая с большим количеством песка вкраплениями пироксена и золотистой слюды.', 'амфора', 'фрагмент', NULL, NULL, NULL, '/', NULL);
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (134, 1, 10, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.6', 'ПАБ-17.280ЖД.18.к.о.45', 'Восточно-Крымский ИКМЗ', 'КП-192255', 'Амфоры синопской горла с верхним и нижним прилепом овальной ручки с клеймом. Клеймо рельефное в прямоугольном поле ретроградное в три строки.', 'амфора', 'фрагмент', '10YR', '6', '4', '10YR 6/4', 'Light Yellowish Brown');
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (135, 1, 15, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.7', 'ПАБ-17.280ЖД.8.к.о.51', 'Восточно-Крымский ИКМЗ', 'КП-192257', '"Амфоры неопределённого центра венчика валикообразного с расширяющимся книзу горлом и овальной ручкой с клеймом фрагмент. Глина светло-коричневая плотная с редкими вкраплениями белых и тёмных частиц блёстками слюды Клеймо рельефное в овальном поле в виде монограммы- буквы «тау» и «эпсилон» в лигатуре."', 'амфора', 'фрагмент', '7.5YR', '5', '4', '7.5YR 5/4', 'Brown');
