INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (137, 1, 9, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.7', 'ПАБ-17.280ЖД.21.к.о.53', 'Восточно-Крымский ИКМЗ', 'КП-192259', 'Амфоры родосской стенки с верхним прилепом овальной ручки с клеймом в подпрямоугольной рамке фрагмент.', 'амфора', 'фрагмент', '10YR', '7', '4', '10YR 7/4', 'Very Pale Brown');
INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (138, 1, 2, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.7', 'ПАБ-17.280ЖД.22.к.о.54', 'Восточно-Крымский ИКМЗ', 'КП-192260', 'Амфоры италийской типа стенки горла с прилепом округлой ручки покрытой светлым ангобом с клеймом фрагмент. Глина плотная светло-красная с серым закалом с включениями мелких тёмных частиц и небольшого количества слюды. Клеймо рельефное в узкой в виде картуша рамке в одну строку.', 'амфора', 'фрагмент', '7.5YR', '6', '4', '7.5YR 6/4', 'Light Brown');
