INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, "position", field_id, depository, depository_id, description, artif_g, preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (140, 1, 3, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.7', 'ПАБ-17.280ЖД.35.к.о.56', 'Восточно-Крымский ИКМЗ', 'КП-192262', 'Амфоры гераклейской венчика трапециевидного со скошенным скругленным внутренним краем и частью горла фрагмент. На горле оттиснуто вертикально под углом к венчику энглифическое клеймо в две строки.', 'амфора', 'фрагмент', '2.5Y', '6', '2', '2.5Y 6/2', 'Light Brownish Gray');
